import React,{useState,useEffect} from "react";

const NovePorudzbine=()=>{

    const [porudzbina, setPorudzbine]=useState([]);

    useEffect(()=>{
        fetch("https://localhost:44388/Porudzbina/allPorudzbineProdavcaNove?korisnikId=11", {
            method: 'GET',
            headers: {
                'Content-Type': 'application/json',
            },
            mode: 'cors',
        })
        .then((response)=> response.json())
        .then((data)=>{
            console.log(data);
            setPorudzbine(data);
        })
        .catch((error)=>{
            console.error("Greška prilikom dobavljanja podataka sa servera:", error);
        });
    },[]);

    return(
        <div>
            <h1 style={{color: "#279980"}}>Moje porudzbine</h1>
            <table>
                <thead>
                    <tr>
                        <th>Adresa Dostave</th>
                        <th>Komentar</th>
                        <th>Vreme isporuke</th>
                    </tr>
                </thead>
                <tbody>
                {porudzbina.map((porudzbina, index)=>(
                    <tr key={index}>
                        <td>{porudzbina.adresaDostave}</td>
                        <td>{porudzbina.komentar}</td>
                        <td>{porudzbina.vremeIsporuke}</td>
                    </tr>
                ))}    
                </tbody>  
            </table>
        </div>
    );
};

export default NovePorudzbine;
